        <img alt={props.name} src={props.image} />
      </div>
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {props.name}
          </li>
          <li>
            <strong>Price:</strong> {props.price}
          </li>

        </ul>
      </div>
      <span onClick={() => props.removeFriend(props.id)} className="remove">
        ùòÖ
      </span>
    </div>
  );
}

